CREATE TABLE sys.syscolumns
(
    name sysname,
    id int NOT NULL,
    xtype tinyint NOT NULL,
    typestat tinyint,
    xusertype smallint,
    length smallint NOT NULL,
    xprec tinyint NOT NULL,
    xscale tinyint NOT NULL,
    colid smallint,
    xoffset smallint,
    bitpos tinyint,
    reserved tinyint,
    colstat smallint,
    cdefault int NOT NULL,
    domain int NOT NULL,
    number smallint,
    colorder smallint,
    autoval varbinary(8000),
    offset smallint,
    collationid int NOT NULL,
    language int,
    status tinyint,
    type tinyint NOT NULL,
    usertype smallint,
    printfmt varchar(255),
    prec smallint,
    scale int,
    iscomputed int,
    isoutparam int,
    isnullable int,
    collation sysname,
    tdscollation binary(5)
);
